Deuxième étape : la gestion des risques
Les risques peuvent être classés en quatre catégories :
- Les risques de projet, à savoir les erreurs humaines, les erreurs matérielles, les retards, la mauvaise gestion des ressources, les ruptures de contrat, les problèmes de coordination, etc. ;
- Les risques financiers, tels que les retards de paiement, le financement des travaux, la mauvaise qualité de la main-d'œuvre et des matériaux, les fluctuations du cours des matières premières, etc. ;
- Les risques de marché, à savoir la qualité des prestations de services, des sous-traitants et des équipements ;
- Les risques politiques, qui peuvent résulter d'une instabilité politique, d'une guerre ou d'un conflit, etc.
