Il faut aussi souligner la nécessité pour la Commission de renforcer son rôle de surveillance au sein du Conseil de sécurité, qui s'articule autour de cinq domaines :

• Les sanctions imposées par le Conseil de sécurité doivent être strictement appliquées et transparentes;

• Il ne faut pas permettre que les régimes de sanctions soient contournés sans conséquences;

• Les organismes des Nations Unies doivent être davantage impliqués dans les régimes de sanctions pour éviter qu'ils ne soient détournés de leur objectif;

• Les régimes de sanctions doivent être revus afin d'éviter les sanctions à double tranchant et les effets négatifs pour les pays tiers qui en sont l'objet;

• Il faut que le Comité des sanctions et le Conseil de sécurité envisagent toutes les possibilités de renforcer l'efficacité des régimes de sanctions
